import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar';
import FlightState from './context/FlightState';

function App() {
  return (
    <>
    <FlightState>
      <Navbar/>
      <Home/>
    </FlightState>
    </>
  );
}

export default App;
